2:10883:5783.docs:
Calculates the hash of a single value.

This is intended as a convenience for code which *consumes* hashes, such
as the implementation of a hash table or in unit tests that check
whether a custom [`Hash`] implementation behaves as expected.

This must not be used in any code which *creates* hashes, such as in an
implementation of [`Hash`].  The way to create a combined hash of
multiple values is to call [`Hash::hash`] multiple times using the same
[`Hasher`], not to call this method repeatedly and combine the results.

# Example

```
#![feature(build_hasher_simple_hash_one)]

use std::cmp::{max, min};
use std::hash::{BuildHasher, Hash, Hasher};
struct OrderAmbivalentPair<T: Ord>(T, T);
impl<T: Ord + Hash> Hash for OrderAmbivalentPair<T> {
    fn hash<H: Hasher>(&self, hasher: &mut H) {
        min(&self.0, &self.1).hash(hasher);
        max(&self.0, &self.1).hash(hasher);
    }
}

// Then later, in a `#[test]` for the type...
let bh = std::collections::hash_map::RandomState::new();
assert_eq!(
    bh.hash_one(OrderAmbivalentPair(1, 2)),
    bh.hash_one(OrderAmbivalentPair(2, 1))
);
assert_eq!(
    bh.hash_one(OrderAmbivalentPair(10, 2)),
    bh.hash_one(&OrderAmbivalentPair(2, 10))
);
```

0:1494:1734.docs:
Represents an HTTP response

An HTTP response consists of a head and a potentially optional body. The body
component is generic, enabling arbitrary types to represent the HTTP body.
For example, the body could be `Vec<u8>`, a `Stream` of byte chunks, or a
value that has been deserialized.

Typically you'll work with responses on the client side as the result of
sending a `Request` and on the server you'll be generating a `Response` to
send back to the client.

# Examples

Creating a `Response` to return

```
use http::{Request, Response, StatusCode};

fn respond_to(req: Request<()>) -> http::Result<Response<()>> {
    let mut builder = Response::builder()
        .header("Foo", "Bar")
        .status(StatusCode::OK);

    if req.headers().contains_key("Another-Header") {
        builder = builder.header("Another-Header", "Ack");
    }

    builder.body(())
}
```

A simple 404 handler

```
use http::{Request, Response, StatusCode};

fn not_found(_req: Request<()>) -> http::Result<Response<()>> {
    Response::builder()
        .status(StatusCode::NOT_FOUND)
        .body(())
}
```

Or otherwise inspecting the result of a request:

```no_run
use http::{Request, Response};

fn get(url: &str) -> http::Result<Response<()>> {
    // ...
# panic!()
}

let response = get("https://www.rust-lang.org/").unwrap();

if !response.status().is_success() {
    panic!("failed to get a successful response status!");
}

if let Some(date) = response.headers().get("Date") {
    // we've got a `Date` header!
}

let body = response.body();
// ...
```

Deserialize a response of bytes via json:

```
# extern crate serde;
# extern crate serde_json;
# extern crate http;
use http::Response;
use serde::de;

fn deserialize<T>(res: Response<Vec<u8>>) -> serde_json::Result<Response<T>>
    where for<'de> T: de::Deserialize<'de>,
{
    let (parts, body) = res.into_parts();
    let body = serde_json::from_slice(&body)?;
    Ok(Response::from_parts(parts, body))
}
#
# fn main() {}
```

Or alternatively, serialize the body of a response to json

```
# extern crate serde;
# extern crate serde_json;
# extern crate http;
use http::Response;
use serde::ser;

fn serialize<T>(res: Response<T>) -> serde_json::Result<Response<Vec<u8>>>
    where T: ser::Serialize,
{
    let (parts, body) = res.into_parts();
    let body = serde_json::to_vec(&body)?;
    Ok(Response::from_parts(parts, body))
}
#
# fn main() {}
```

